class WordNotFound(Exception):
    pass

def lookup_dict(word):
    '''returns the Plain word's IPA pronunciation, if any.'''
    try:
        ipa = dictionary[word]
        return ipa
    except KeyError:
        print('Word not found in dictionary: ')
        raise WordNotFound


def reverse_lookup_dict(ipa):
    '''returns the Plain word, based on the IPA pronunciation.
    Extremely unwieldy, as pronunciations may vary greatly.'''
    for word, pronunciation in dictionary.items():
        # no syllables in cmudict
        ipa = ipa.replace("'", '')
        if pronunciation == ipa:
            return word

    print('Pronunciation not found in dictionary')
    raise WordNotFound
